    "description" : "<p>Nahko, an Oregon-native born a mix of Puerto Rican, Native American, and Filipino bloodlines considers himself a citizen in service to the planet. &nbsp;Disillusioned by the world around him and inspired by vagabond, Americana musicians and&nbsp;storytellers like Conor Oberst and Bob Dylan, Nahko left home as a teenager in search of adventure and self discovery. &nbsp;Armed with stories, a guitar, and a fierce set of ideals, he set out to bridge the cultural gaps dividing his own psyche. He&nbsp;began producing a public, musical journal of his journey toward personal, spiritual, and social healing, and thus Medicine for the People was born. Recently, Nahko discussed his successes, his philosophies, his music, and his life with&nbsp;Huffington Post, who called Nahko&rsquo;s music &ldquo;beautiful and stirring.&rdquo; Nahko describes his music as a mix of hip-hop and folk rock with a world message.</p>",
