    "eventname" : "The Steel Wheels, David Jacobs-Strain",
    "description" : "<p>Some things come to be in their own time, of their own accord. Such has been the case with The Steel Wheels. In the beginning, it was simply a matter of four young men who&rsquo;d happened to cross paths at a formative moment in each of their lives reveling in the shared experience of plucking acoustic instruments and blending their voices. But over the years, what had begun organically as a pure lark evolved into a mission: to fuse the personal with the universal, the deeply rooted past with the joys and sorrows of everyday existence.<br />\r\n<br />\r\nThese thematic and stylistic vectors intersect powerfully on Leave Some Things Behind (released April 14 on the band&rsquo;s own Big Ring label), a deeply human, emotionally authentic work that interweaves timely songs with timeless sounds. On the album, co-produced and engineered by Ben Surratt, the four band members&mdash;lead singer/guitarist/banjo player Trent Wagler, standup bass player Brian Dickel, fiddler Eric Brubaker and mandolin player Jay Lapp&mdash;are joined on various tracks by rootsmusic luminary Tim O&rsquo;Brien, Nashville-based singer/songwriter Sarah Siskind (who co-wrote two songs and sang on another), drummer Travis Whitmore and Hammond B3 player Ethan Ballinger. Together, they&rsquo;ve wrought a work that is musically intricate and conceptually resonant, the sounds serving the songs at every moment.<br />\r\n<br />\r\nMemorable original tunes like the sorrowful &ldquo;Heaven Don&rsquo;t Come by Here,&rdquo; the anxious &ldquo;End of the World Again,&rdquo; the a cappella tour de force &ldquo;Promised Land,&rdquo; the indigenously metaphorical &ldquo;Find Your Mountain,&rdquo; the autobiographical &ldquo;Rescue Me, Virginia&rdquo; and the climactic &ldquo;Every Song Is a Love Song&rdquo; are bound by a plainspoken eloquence and an unforced urgency, while the dual kickers &ldquo;We&rsquo;ve Got a Fire&rdquo; and &ldquo;Warm Wool, Soft Leather&rdquo; seem tailor-made for the Grand Ole Opry stage circa 1968&mdash;as if intimating some of those precious things we&rsquo;ve left behind.<br />\r\n<br />\r\nThe band&rsquo;s genesis dates back to 2004, when Wagler, Dickel and Brubaker were college students in Harrisonburg, Virginia, which sits in the Shenandoah Valley an hour&rsquo;s drive from Charlottesville. &ldquo;The school we met at is Eastern Mennonite University,&rdquo; Wagler recalls, punctuating the reveal with a wry chuckle. &ldquo;That begs the next question, which is, &lsquo;Why in the world did you go to Eastern Mennonite University?&rsquo; One of the unique things about our band is that all four of us grew up in Mennonite families&mdash;and I hesitate to even use the word because many people who don&rsquo;t have much experience with Mennonites see that as Amish, but that&rsquo;s not accurate. It was more of a secular Mennonite upbringing. So that was where the three of us met, but we didn&rsquo;t start the band right away.&rdquo;<br />\r\n<br />\r\n&nbsp;</p>",
