    "eventname" : "Poor Man's Whiskey performs \"Graceland\" Featuring Coral Creek",
    "description" : "<p>Poor Man&#39;s Whiskey Performs &quot;Graceland&quot;!</p>\r\n\r\n<p>Join Northern California&#39;s jamgrass sensations Poor Man&#39;s Whiskey for a set of original upbeat Bluegrass/ Americana and a special second set of their interpretation of the iconic album &quot;Graceland&quot;</p>\r\n\r\n<p>by Paul Simon.</p>\r\n\r\n<p>POOR MAN&#39;S WHISKEY:</p>\r\n\r\n<p>Northern California&#39;s outlaw music bards bring a reputation for high-energy live shows and an incomparable fusion of bluegrass/old time, southern rock, and old school jam to stages and festivals worldwide. Poor Man&#39;s Whiskey has been growing exponentially in the past 5 years selling out venues across the country such as the legendary Fillmore in SF. This &quot;High-Octane Hootenanny&quot; will certainly delight those interested in a foot-stompin good time. Poor Man&#39;s Whiskey has evolved into a ragged, spontaneous beast pulling from equally deep wells of story-telling originals, expertly crafted covers and zany on-stage shenanigans. PMW has released 6 studio albums and have a stunning repertoire to choose songs from creating a new show every night.</p>\r\n\r\n<p>Notable Festivals and Shows:</p>\r\n\r\n<p>Hardly Strictly Bluegrass Festival, Byron Bay Blues and Roots Music Festival (Australia), High Sierra Music Festival, Wakarusa Music Festival, Yonder Mountain Harvest Festival, Kate Wolf Music Festival, Phases of the Moon, Hillside Music Festival (Canada), Evolve Festival, (Canada) Harmony Festival, Strawberry Music Festival, Dead on the Creek, 4 Peaks Music Festival, Joshua Tree Music Festival,TheSummerMeltdown,LasTortugas, LohiMusicFestival,TellurideBluegrassFestival(band competition finalists), Salmonstock Music Festival, String Cheese&#39;s Horning&#39;s Hideout, Multiple sell out shows at the Fillmore San Francisco, and many many more.</p>\r\n\r\n<p>POOR MAN&#39;S WHISKEY IS:</p>\r\n\r\n<p>Jason Beard- Guitar, Mandolin</p>\r\n\r\n<p>Josh Brough - Vocals, Banjo, Keyboards,</p>\r\n\r\n<p>Jeff Coleman- Keyboards</p>\r\n\r\n<p>Mark Murphy- Bass</p>\r\n\r\n<p>David Noble - Guitar, Vocals</p>\r\n\r\n<p>George Smeltz - Drums, Vocals</p>\r\n\r\n<p>BAND DISCOVERY:</p>\r\n\r\n<p>Rock Star On The Weekend-2016</p>\r\n\r\n<p>Whiskey Under the Bridge-2015</p>\r\n\r\n<p>Barrel Aged Whiskey (compilation)- 2014</p>\r\n\r\n<p>Like a River-2012</p>\r\n\r\n<p>Goodbye California-2011</p>\r\n\r\n<p>Dark Side of the Moonshine-2009</p>\r\n\r\n<p>Roadside Attraction-2005</p>\r\n\r\n<p>Train To California-2003</p>",
