    "eventname" : "The Aggrolites, The Tahoes",
    "description" : "<p>The Aggrolites are more than a band they are a movement unto themselves. They carry a banner - one created with their own hands. This banner reads, &ldquo;Dirty Reggae,&rdquo; and represents their signature fusion of reggae, soul, grit and determination. For seven magnificent years, this dirty reggae bunch has rolled from city to city, across the pond and up main street USA. They rally the kids, the parents, the students, the cops, the bosses and the drifters. The people come, they relish in The Aggrolites, the dirty reggae and the joy that comes with it all. The liberating rhythms and catchy grooves demand a return trip.<br />\r\n<br />\r\nOut of the Los Angeles school of hard knocks, The Aggrolites have earned a Ph.D in &quot;feel good music.&quot; On the road they educate with the thunder and punch of the reggae drums and bass, the ripping, soulful melodies of the organ and guitars, and Jesse Wagner&rsquo;s voice - a gift from the heavens, a perfectly intact gift from Otis, Sam, Ray and Wilson.<br />\r\n<br />\r\nAfter eight years of touring the globe, The Aggrolites are proud to reveal their first live album, Unleashed Live Vol. 1. With five previous studio releases under their belt, including recently released Rugged Road, the next logical move for the band was a compilation of their favorite songs recorded live from recent shows at The Belly Up in Solana Beach, CA and The Roxy Theatre in Los Angeles, CA. Unleashed Live Vol. 1 features songs from all four previous studio releases plus a version of The Beatles &ldquo;Don&rsquo;t Let Me Down&rdquo; and &ldquo;Banana&rdquo; by the legendary reggae artist, Roy Ellis. Release date will be announced sometime this fall and available digitally worldwide and in select retail outlets nationwide.&nbsp;<br />\r\n<br />\r\nThe Aggrolites have a specific way of making music. They don&#39;t over think it, they don&#39;t obsess over pop culture demands, they walk onto a stage or into a recording studio and let &quot;it&quot; happen - a culmination of inspiration - from the road, from playing alongside legends, and from the energy and motivation of their die hard fans.<br />\r\n<br />\r\nThe Aggrolites are Jesse Wagner (vocals, lead guitar), Roger Rivas (organ), Jeff Roffredo (bass) and Alex Mckenzie(Drums).</p>",
